	(651, '2020-11-18 11:49:20.870000', '66', '<p>第5章-5	统计字符出现次数 给予一段字符串（少于80个字符）；给予一个字符。统计给予字符在给定字符串中出现的次数。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163034891574829060">https://pintia.cn/problem-sets/111165210071811686', 2, '[]', 6, 1),
	(652, '2020-11-18 11:49:36.279000', '1', '<p>逐一处理文本文件中的字符。统计文件中的大写字母、小写字母和数字出现的次数。函数返回一个元组，第一个元素是大写字母的个数，第二个元素是小写字母的个数，第三个元素是数字的个数</p>', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
