	(658, '2020-11-18 11:50:02.425000', '18', '<p>第4章-23 求矩阵的局部极大值 给定M行N列的整数矩阵A，如果A的非边界元素A[i][j]大于相邻的上下左右4个元素，那么就称元素A[i][j]是矩阵的局部极大值。本题要求给定矩阵的全部局部极大值及其所在的位置。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163032889524477971" ', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(659, '2020-11-18 11:50:05.923000', '19', '<p>输入2个正整数lower和upper（lower≤upper≤100），请输出一张取值范围为[lower，upper]、且每次增加2华氏度的华氏-摄氏温度转换表。  温度转换的计算公式：C=5×(F−32)/9，其中：C表示摄氏温度，F表示华氏温度。在一行中输入2个整数，分别表示lower和upper的值，中间用空格分开。第一行输出："fahr celsius"  接着每行输出一个华氏温度f', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(660, '2020-11-18 11:50:09.920000', '19', '<p>输入2个正整数lower和upper（lower≤upper≤100），请输出一张取值范围为[lower，upper]、且每次增加2华氏度的华氏-摄氏温度转换表。  温度转换的计算公式：C=5×(F−32)/9，其中：C表示摄氏温度，F表示华氏温度。在一行中输入2个整数，分别表示lower和upper的值，中间用空格分开。第一行输出："fahr celsius"  接着每行输出一个华氏温度f', 2, '[]', 6, 1),
	(661, '2020-11-18 11:50:33.741000', '23', '<p>下列哪个语句在Python中是非法的？</p>', 2, '[{"changed": {"fields": ["question", "difficulty", "tags"]}}]', 6, 1),
