	(698, '2020-11-18 11:54:33.893000', '4', '<p>第3章-21 判断回文字符串   输入一个字符串，判断该字符串是否为回文。回文就是字符串中心对称，从左向右读和从右向左读的内容是一样的。给出一个不超过80个字符长度的非空字符串，返回true或false。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180305">https', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(699, '2020-11-18 11:54:44.502000', '16', '<p>第3章-16本题要求编写程序，将给定字符串去掉重复的字符后，按照字符ASCII码顺序从小到大排序后输出。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180300">https://pintia.cn/problem-sets/1111652100718116864/prob', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(700, '2020-11-18 11:54:51.204000', '16', '<p>第3章-16本题要求编写程序，将给定字符串去掉重复的字符后，按照字符ASCII码顺序从小到大排序后输出。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180300">https://pintia.cn/problem-sets/1111652100718116864/prob', 2, '[]', 6, 1),
	(701, '2020-11-18 11:54:54.695000', '27', '<p>第4章-20 求矩阵各行元素之和。本题要求编写程序，求一个给定的m×n矩阵各行元素之和。输入第一行给出两个正整数m和n（1≤m,n≤6）。随后m行，每行给出n个整数，其间  以空格分隔 每行输出对应矩阵行元素之和。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163032889524477967">', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(702, '2020-11-18 11:54:58.176000', '21', '<p>求整数序列中出现次数最多的数</p>', 2, '[{"changed": {"fields": ["difficulty"]}}]', 6, 1),
	(703, '2020-11-18 11:55:02.010000', '48', '<p>输入2个正整数lower和upper（lower≤upper≤100），请输出一张取值范围为[lower，upper]、且每次增加2华氏度的华氏-摄氏温度转换表。  温度转换的计算公式：C=5×(F−32)/9，其中：C表示摄氏温度，F表示华氏温度。在一行中输入2个整数，分别表示lower和upper的值，中间用空格分开。第一行输出："fahr celsius"  接着每行输出一个华氏温度f', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(704, '2020-11-18 11:55:05.501000', '17', '<p>求1!+3!+5!+……+n!的和，要求用循环嵌套设计，n&lt;12。</p>', 2, '[{"changed": {"fields": ["difficulty"]}}]', 6, 1),
	(705, '2020-11-18 11:55:19.285000', '55', '<p>第6章-8 输出全排列输入整数n（3&lt;=n&lt;=7）,编写程序输出1,2,...,n整数的全排列，按字典序输出(输入格式：一行输入正整数n，输出格式：按字典序输出1到n的全排列。每种排列占一行，数字间无空格)<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163035698160459787', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(706, '2020-11-18 11:55:28.951000', '53', '<p>判断一个给定的正整数是否素数</p>', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(707, '2020-11-18 11:55:33.731000', '52', '<p>第3章-20 读入一个正3位数，然后输出逆序<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180304" rel="nofollow">https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(708, '2020-11-18 11:55:37.600000', '51', '<p>第4章-2 统计给定整数M和N区间内素数的个数并对它们求和。输入格式：输入在一行中给出两个正整数M和N（1≤M≤N≤500）。输出格式:  在一行中顺序输出M和N区间内素数的个数以及它们的和，数字间以空格分隔。题目链接:<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/116303288952447795', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(709, '2020-11-18 11:55:41.512000', '50', '<p>第3章-10 统计大写辅音字母：英文辅音字母是除A、E、I、O、U以外的字母。本题要求编写程序，统计给定字符串中大写辅音字母的个数。 输入格式：  输入在一行中给出一个不超过80个字符、并以回车结束的字符串。  输出格式：  输出在一行中给出字符串中大写辅音字母的个数输入样例：  HELLO World! 输出样例：  4。题目链接：<a href="https://pintia.cn/pr', 2, '[{"changed": {"fields": ["question"]}}]', 6, 1),
	(710, '2020-11-18 11:55:45.100000', '49', '<p>第2章-4.给定两个均不超过9的正整数a和n，要求编写程序求a+aa+aaa++⋯+aa⋯a（n个a）之和。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1111653447408467975" rel="nofollow">https://pintia.cn/problem-sets/1111652', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(711, '2020-11-18 11:55:50.524000', '48', '<p>输入2个正整数lower和upper（lower≤upper≤100），请输出一张取值范围为[lower，upper]、且每次增加2华氏度的华氏-摄氏温度转换表。  温度转换的计算公式：C=5×(F−32)/9，其中：C表示摄氏温度，F表示华氏温度。在一行中输入2个整数，分别表示lower和upper的值，中间用空格分开。第一行输出："fahr celsius"  接着每行输出一个华氏温度f', 2, '[]', 6, 1),
	(712, '2020-11-18 11:55:55.336000', '48', '<p>输入2个正整数lower和upper（lower≤upper≤100），请输出一张取值范围为[lower，upper]、且每次增加2华氏度的华氏-摄氏温度转换表。  温度转换的计算公式：C=5×(F−32)/9，其中：C表示摄氏温度，F表示华氏温度。在一行中输入2个整数，分别表示lower和upper的值，中间用空格分开。第一行输出："fahr celsius"  接着每行输出一个华氏温度f', 2, '[]', 6, 1),
	(713, '2020-11-18 11:55:59.934000', '46', '<p>第3章-21 判断回文字符串   输入一个字符串，判断该字符是否为回文。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180305" rel="nofollow">https://pintia.cn/problem-sets/1111652100718116864/probl', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(714, '2020-11-18 11:56:09.363000', '47', '<p>输入一个整数和进制，转换成十进制输出</p>', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(715, '2020-11-18 11:56:18.681000', '45', '<p>n位数“水仙花数”</p>', 2, '[{"changed": {"fields": ["difficulty"]}}]', 6, 1),
	(716, '2020-11-18 11:56:25.683000', '44', '<p>第3章-7 求最大值及其下标:找出给定的n个数中的最大值及其对应的最小下标（下标从0开始）链接：<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180291" rel="nofollow">https://pintia.cn/problem-sets/1111652100718', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(717, '2020-11-18 11:56:30.591000', '43', '<p>第1章-1 从键盘输入两个数，求它们的和并输出题目链接:<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1111653039147499521" rel="nofollow">https://pintia.cn/problem-sets/1111652100718116864/problems/1111', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(718, '2020-11-18 11:56:35.415000', '42', '<p>第3章-8 字符串逆序 (15分)，输入在一行中给出一个不超过80个字符长度的、以回车结束的非空字符串。在一行中输出逆序后的字符串。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180292" rel="nofollow">https://pintia.cn/problem-', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(719, '2020-11-18 11:56:40.391000', '41', '<p>下面不能创建一个集合的语句是</p>', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(720, '2020-11-18 11:56:44.592000', '40', '<p>本题要求对任意给定的一位正整数N，输出从1*1到N*N的部分口诀表。</p>', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(721, '2020-11-18 11:56:55.563000', '39', '<p>第2章-7 产生每位数字相同的n位数 : 输入2个正整数A和B，1&lt;=A&lt;=9,1&lt;=B&lt;=10,产生数字 AA...A,一共B个A<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1111653447408467980">https://pintia.cn/problem-set', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(722, '2020-11-18 11:57:07.395000', '36', '<p>第4章-10最大公约数和最小公倍数；要求两个给定正整数的最大公约数和最小公倍数。</p>', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(723, '2020-11-18 11:57:11.648000', '35', '<p>第3章-17 删除字符;输入一个字符串 str，再输入要删除字符 c，大小写不区分，将字符串 str 中出现的所有字符 c 删除。提示：去掉空格。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180301" rel="nofollow">https://pintia.cn/p', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(724, '2020-11-18 11:57:16.393000', '33', '<p>第3章-18随机输入一个字符串，把最左边的10个不重复的英文字母（不区分大小写）挑选出来。 如没有10个英文字母，显示信息“not found”<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180302">https://pintia.cn/problem-sets/1111', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(725, '2020-11-18 11:57:21.372000', '32', '<p>第2章-13 分段计算居民水费 为鼓励居民节约用水，自来水公司采取按用水量阶梯式计价的办法，居民应交水费y（元）与月用水量x（吨）相关：当x不超过15吨时，y=4x/3；超过后，y=2.5x−17.5。请编写程序实现水费的计算。</p>', 2, '[{"changed": {"fields": ["difficulty"]}}]', 6, 1),
	(726, '2020-11-18 11:57:25.361000', '31', '<p>输入一个字符串  判断该字符串是否为回文</p>', 2, '[]', 6, 1),
	(727, '2020-11-18 11:57:30.562000', '29', '<p>第2章-2本题目要求计算下列分段函数f(x)的值<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1111653447408467968">https://pintia.cn/problem-sets/1111652100718116864/problems/1111653447408467968</a>', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(728, '2020-11-18 11:57:38.542000', '14', '<p>第1章-3 输出“Python语言简单易学” 输出一句短语，Python语言简单易学。  如果包含汉字，用"print(s.encode("utf-8"))"输出.<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1111653039147499520">https://pintia.cn/problem', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(729, '2020-11-18 11:57:41.611000', '15', '<p>第2章-14    给定两个整数A和B，输出从A到B的所有整数以及这些数的和。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1111653447408467978">https://pintia.cn/problem-sets/1111652100718116864/problems/11116534', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(730, '2020-11-18 11:57:45.389000', '16', '<p>第3章-16本题要求编写程序，将给定字符串去掉重复的字符后，按照字符ASCII码顺序从小到大排序后输出。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163031535431180300">https://pintia.cn/problem-sets/1111652100718116864/prob', 2, '[]', 6, 1),
	(731, '2020-11-18 11:57:49.418000', '17', '<p>求1!+3!+5!+……+n!的和，要求用循环嵌套设计，n&lt;12。</p>', 2, '[]', 6, 1),
	(732, '2020-11-18 11:57:54.367000', '18', '<p>第4章-23 求矩阵的局部极大值 给定M行N列的整数矩阵A，如果A的非边界元素A[i][j]大于相邻的上下左右4个元素，那么就称元素A[i][j]是矩阵的局部极大值。本题要求给定矩阵的全部局部极大值及其所在的位置。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163032889524477971">', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(733, '2020-11-18 11:57:58.352000', '19', '<p>输入2个正整数lower和upper（lower≤upper≤100），请输出一张取值范围为[lower，upper]、且每次增加2华氏度的华氏-摄氏温度转换表。  温度转换的计算公式：C=5×(F−32)/9，其中：C表示摄氏温度，F表示华氏温度。在一行中输入2个整数，分别表示lower和upper的值，中间用空格分开。第一行输出："fahr celsius"  接着每行输出一个华氏温度f', 2, '[{"changed": {"fields": ["difficulty"]}}]', 6, 1),
	(734, '2020-11-18 11:58:03.144000', '20', '<p>本题要求统计给定整数M和N区间内素数的个数并对它们求和。</p>', 2, '[{"changed": {"fields": ["difficulty"]}}]', 6, 1),
	(735, '2020-11-18 11:58:06.734000', '21', '<p>求整数序列中出现次数最多的数</p>', 2, '[]', 6, 1),
	(736, '2020-11-18 11:58:11.629000', '22', '<p>第4章-1   生成3的乘方表。输入一个非负整数n，生成一张3的乘方表，输出3 º​​ ~3 ​ⁿ ​​ 的值。可调用幂函数计算3的乘方。输出为一个列表。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1163032889524477952">https://pintia.cn/problem-sets', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(737, '2020-11-18 11:58:26.214000', '24', '<p>第2章-1 计算 11+12+13+...+m。定义函数f(m)，计算 11+12+13+...+m 的值。<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1111653447408467981">https://pintia.cn/problem-sets/1111652100718116864/pr', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(738, '2020-11-18 11:58:29.864000', '25', '<p>第2章-3 阶梯电价：为了提倡居民节约用电，某省电力公司执行“阶梯电价”，安装一户一表的居民用户电价分为两个“阶梯”：月用电量50千瓦时（含50千瓦时）以内的，电价为0.53元/千瓦时；超过50千瓦时的，超出部分的用电量，电价上调0.05元/千瓦时。请编写程序计算电费。<a href="https://pintia.cn/problem-sets/1111652100718116864/pr', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
	(739, '2020-11-18 11:58:39.180000', '28', '<p>第2章-5<a href="https://pintia.cn/problem-sets/1111652100718116864/problems/1111653447408467970">https://pintia.cn/problem-sets/1111652100718116864/problems/1111653447408467970</a>要求对两个正整数m和n（m≤n）编写程', 2, '[{"changed": {"fields": ["question", "difficulty"]}}]', 6, 1),
